// src/index.js

import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './styles.css'; // Optional: Add global styles if needed

ReactDOM.render(
    <React.StrictMode>
        <App />
    </React.StrictMode>,
    document.getElementById('root')
);
